import React, { Component } from "react";
import { MainHeader } from "../Components/MainBackground";


class Home extends Component {
  render() {
    return (
      <MainHeader>
        <h2>Festival of Elves</h2>
      </MainHeader>
    );
  }
}

export default Home;


